import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
			<div>
					<Link to="/">Esse não atualiza a página</Link>
			</div>
    );
  }
}
